// Header.js
import React from 'react';
import '../styles/Header.css';
import logo from '../logo.jpg';


const Navordi = () => {
  return (
    <div className="header">
        <img className="logo" src={logo} alt="logo" />
      <h1></h1>
    </div>
  );
};

export default Navordi;
